function getTreeSettings(treeId) {
    var prodTypeTreeCallbacks = {}
    $.extend(prodTypeTreeCallbacks,getSinglePathCallbacks(treeId),getAutoExpandCallbacks(treeId))

    return {
        check:{
            enable:true,
            chkStyle:"radio",
            radioType:"all"
        },
        data: {
            simpleDate:{
                enable: false
            }
        },
        view: {
            showIcon: false,
            showLine: false,
            dblClickExpand: false
        },
        callback: prodTypeTreeCallbacks
    };
}

function buildCategoryDataStruct() {
    //构造分类的json数据结构
    var categoryData = {};
    for (var i = 0; i< subCategoryData.length; i ++) {
        var cat = subCategoryData[i];
        //构造node
        var node = {};
        node.id = cat.prodTypeId;
        node.name = cat.name;
        if (cat.parentId in categoryData) {
            categoryData[cat.parentId].children.push(node);
        }else {
            // 构造父node
            var parent = {};
            parent.id = cat.parentId;
            parent.name = wuba_top_categories[cat.parentId]
            parent.nocheck = true;

            parent.children = [];
            parent.children.push(node);
            categoryData[cat.parentId] = parent;
        }
    }
    var categories=[];
    for (var key in categoryData) {
        categories.push(categoryData[key]);
    }
    return categories;
}
function batchAddCityNode(id, name) {
    //先创建城市节点
    var cityNode = {};
    cityNode.id = id;
    cityNode.name = name;
    cityNode.nocheck = true;
    cityNode.children = [];
    //循环创建区域
    $.each(wuba_areas, function(i, item){
        if (item.cityId == cityNode.id) {
            var areaNode = {};
            areaNode.id = item.areaId;
            areaNode.name = item.areaName;
            areaNode.nocheck = true;
            areaNode.children = []
            //循环创建商圈
            $.each(wuba_circles, function(j, circleItem){
                if (circleItem.areaId == areaNode.id) {
                    var circleNode = {};
                    circleNode.id = circleItem.circleId;
                    circleNode.name = circleItem.circleName;
                    areaNode.children.push(circleNode);
                }
            });
            cityNode.children.push(areaNode);
        }
    });

    //依次添加到各个tree中去
    $("ul[id^='ybqCircleName'].ztree").each(function(){
        var treeEle = $(this);
        var tree = $.fn.zTree.getZTreeObj(treeEle.attr('id'));
        tree.addNodes(null, cityNode, false);
    });
}
function  expandSinglePathToRoot(tree, node) {
    while(node.getParentNode()) {
        node = node.getParentNode();
        tree.expandNode(node, true,false)
    }
}

$(function(){
    // 初始化分类树
    $.fn.zTree.init($("#prodTypeTree"), getTreeSettings("prodTypeTree"), buildCategoryDataStruct());

    //自动选中分类为中餐，并展开
    var prodTypeTree = $.fn.zTree.getZTreeObj('prodTypeTree');
    var zhongcanNode = prodTypeTree.getNodeByParam('name', '中餐', null);
    if (zhongcanNode) {
        prodTypeTree.checkNode(zhongcanNode, true,false);
        expandSinglePathToRoot(prodTypeTree, zhongcanNode);
    }

    // 初始化所有分店的商圈树
    $("ul[id^='ybqCircleName'].ztree").each(function(){
        var ele = $(this);
        var id = ele.attr('id');
        $.fn.zTree.init(ele, getTreeSettings(id), []);
    });

    //当选择或者取消选择城市时，自动更新门店中可选的城市列表
    $("input[name='cityIds']").click(function(){
        var ele = $(this);
        if(ele.attr("checked")) {
            //添加树
            batchAddCityNode(ele.val(), ele.attr('city'));
        } else {
            //依次从各个tree中删除
            $("ul[id^='ybqCircleName'].ztree").each(function(){
                var treeEle = $(this);
                var tree = $.fn.zTree.getZTreeObj(treeEle.attr('id'));
                var node = tree.getNodeByParam('id', ele.val(), null);
                if (node) {
                    tree.removeNode(node);
                }
            });
        }
        return true;
    });

    // 所有门店的商圈tree添加上海这个城市
    batchAddCityNode('4', '上海');

    // 自动选择门店中的商圈
    $("ul[id^='ybqCircleName']").each(function(){
        var treeEle = $(this);
        var tree = $.fn.zTree.getZTreeObj(treeEle.attr('id'));
        var hint = $("#hint-" + treeEle.attr('id'));
        var node = tree.getNodeByParam('name', hint.text(), null);
        if (node) {
            tree.checkNode(node, true,false);
            hint.text(hint.text() + '(已自动选中)')
            hint.css('color', '#08c')
        }else{
            hint.text(hint.text() + '(未能自动选中,请手动选择)')
            hint.css('color', 'red')
        }
    });
});
